INSERT INTO entries (id, content, created_at, updated_at, word_count, sentiment_score, device_id) VALUES
('2bb2323e-9cea-4411-911c-8dc2b57821ae', '<p>Had an amazing breakthrough in therapy today. We talked about setting boundaries and I finally feel like I have concrete strategies to protect my peace. Left feeling empowered and hopeful. This is exactly what I needed. Looking forward to seeing where this journey takes me in the coming weeks.</p>', 1759808941440, 1759808963226, 54, 2.8, 'demo-device'),
('62a45b08-c427-45b7-bcc5-52cceb5295d1', '<p>Crushed my morning run today! Hit a new personal record for my 5K time. The weather was perfect, cool breeze, clear sky. Felt so alive and strong. These moments remind me why I keep showing up. Taking time to reflect on this experience has been incredibly valuable for my growth.</p>', 1759895341440, 1759895363226, 59, 3.2, 'demo-device'),
('abdabc5d-3109-49c7-8ff3-88dcff6b01c5', '<p>Spent the entire day with my family at the park. Kids were laughing, parents were relaxed, and we just enjoyed being together. No screens, no agenda, just quality time. These are the memories I want to hold onto forever.</p>', 1759981741440, 1759981763226, 51, 0.4, 'demo-device'),
('2ff98ff1-7b49-440a-be5b-aacb26f7fa2f', '<p>Finished reading that book on cognitive behavioral therapy and it genuinely changed my perspective. Started applying the reframing techniques immediately. Already noticing small shifts in how I respond to stress. Excited to keep learning. These moments of clarity help me stay grounded and focused on what truly matters.</p>', 1760068141440, 1760068163226, 56, 2.5, 'demo-device'),
('1aed759d-e398-4a3a-a324-ebf2840090e3', '<p>Celebrated my promotion today with the team! All the late nights and hard work finally paid off. Manager gave amazing feedback in front of everyone. Feeling proud, grateful, and motivated to keep pushing forward in my career. Grateful for the opportunity to learn and grow through these everyday experiences and challenges.</p>', 1760154541440, 1760154563226, 58, -1.2, 'demo-device'),
('3052c7bb-2bde-4258-813f-ea38a0b60010', '<p>Tried a new pasta recipe tonight and it turned out incredible. Cooking has become such a creative outlet for me. Love experimenting with flavors and textures. Made enough to share with neighbors, and their reactions made my night. This kind of mindful reflection is exactly what I need to maintain balance and perspective.</p>', 1760240941440, 1760240963226, 60, 1.8, 'demo-device'),
('f309a4a0-3e1b-4540-a373-d5ab4c2fa169', '<p>Morning meditation practice is really starting to stick. Twenty minutes of stillness before the day begins has changed everything. Feel more centered, less reactive, more intentional. This habit is becoming non-negotiable. Excited to build on this momentum and see what positive changes emerge over time.</p>', 1760327341440, 1760327363226, 53, 2.7, 'demo-device'),
('a73182ab-597c-47f5-9a53-651bf007d8bf', '<p>Had the best conversation with an old friend today. We reconnected after months apart and fell right back into our rhythm. Laughed until our stomachs hurt. Reminded me how important it is to nurture these relationships. Appreciating the small wins and learning from setbacks as I move forward each day.</p>', 1760413741440, 1760413763226, 58, -0.3, 'demo-device'),
('1dd7ae26-86e9-41ae-bdf1-41f8bd6a718a', '<p>Started learning Python this week and actually built my first working script today! It is simple but functional. Love the feeling of solving problems through code. Excited to keep building my technical skills. This process of self-discovery continues to reveal new insights about my patterns and habits.</p>', 1760586541440, 1760586563226, 55, 2.1, 'demo-device'),
('e2b3508f-44f4-4b01-b2f4-10620b3fad81', '<p>Took time to write down everything I am grateful for this month. My health, my support system, the roof over my head, meaningful work. Sometimes I forget to appreciate what I have. This practice grounds me. Recognizing these patterns helps me make more intentional choices in how I spend my energy.</p>', 1760759341440, 1760759363226, 57, 2.9, 'demo-device'),
('7c3c4363-ffeb-4281-ab67-1546430a951c', '<p>Hit the gym early this morning and the endorphin rush carried me through the whole day. Strength training is becoming something I actually look forward to, not something I dread. Progress feels amazing. Looking forward to seeing where this journey takes me in the coming weeks.</p>', 1760932141440, 1760932163226, 54, 0.8, 'demo-device'),
('c6b53a9e-2e19-4010-9f18-8ff57af812e0', '<p>My partner surprised me with a weekend getaway. No work, no obligations, just us exploring a new city together. These moments of adventure and connection are what life is about. Feeling so loved and appreciated. Taking time to reflect on this experience has been incredibly valuable for my growth.</p>', 1761104941440, 1761104963226, 57, 3.4, 'demo-device'),
('d5a2f46b-9fed-4cd0-8442-494f466773d1', '<p>Project deadline is coming up next week and I am feeling the pressure. Team is working hard but there are still unknowns. Trying to stay organized and communicate clearly. One step at a time. I''m committed to continuing this practice and seeing how it transforms my daily life.</p>', 1761277741440, 1761277763226, 53, -0.6, 'demo-device'),
('5537e446-5c3e-4611-bf00-fa42ff21351c', '<p>Had a routine checkup with my doctor today. Everything looks normal but we are monitoring a few things. Trying not to overthink it. Taking care of my health is important even when it feels like just another task. These moments of clarity help me stay grounded and focused on what truly matters.</p>', 1761364141440, 1761364163226, 59, 1.4, 'demo-device'),
('40d3418c-0475-4eb0-9dc6-1cf9117db8e0', '<p>Spent the afternoon planning out my goals for the next quarter. Want to focus on skill development and building better routines. It feels good to have direction but also slightly overwhelming. Need to break it down into smaller steps.</p>', 1761450541440, 1761450563226, 50, 0.5, 'demo-device'),
('9b48a330-77ce-484b-ba2a-ce487b140179', '<p>Navigating a tricky situation at work with a colleague. We have different communication styles and it is causing friction. Trying to approach this with empathy and find common ground. Conflict is uncomfortable but necessary sometimes. This kind of mindful reflection is exactly what I need to maintain balance and perspective.</p>', 1761536941440, 1761536963226, 57, -1.7, 'demo-device'),
('2fc47910-f72a-421d-85ea-513da4671477', '<p>Reflecting on my relationship patterns. Noticing I tend to avoid difficult conversations. Working on being more direct and honest about my needs. Growth is uncomfortable but I know it is worth it. Excited to build on this momentum and see what positive changes emerge over time.</p>', 1761623341440, 1761623363226, 54, 2.3, 'demo-device'),
('d235b86e-eb40-4ed1-ab50-7606e7b96f82', '<p>Had a family dinner tonight. Conversations were a mix of lighthearted and tense. We all love each other but sometimes personalities clash. Trying to accept people as they are without trying to change them. Appreciating the small wins and learning from setbacks as I move forward each day.</p>', 1761709741440, 1761709763226, 56, 0.2, 'demo-device'),
('3e4caef4-4a96-4c4f-a8f7-e5500a199286', '<p>Pushed through a tough workout even though I did not feel like it. Sometimes discipline matters more than motivation. Did not break any records but I showed up and that counts for something. This process of self-discovery continues to reveal new insights about my patterns and habits.</p>', 1761796141440, 1761796163226, 55, -0.4, 'demo-device'),
('627b19c6-64b7-4073-a54c-aef1bcda4f58', '<p>Learning a new skill is humbling. Made a lot of mistakes today in my coding practice but that is part of the process. Trying to be patient with myself and trust that incremental progress adds up. Recognizing these patterns helps me make more intentional choices in how I spend my energy.</p>', 1761882541440, 1761882563226, 56, 1.6, 'demo-device'),
('e0505db6-c46d-45b4-9f61-b703c2969209', '<p>Balancing work deadlines with personal time is always a challenge. Trying to set better boundaries but it is easier said than done. Some days I manage it well, other days not so much. Progress over perfection. Looking forward to seeing where this journey takes me in the coming weeks.</p>', 1761968941440, 1761968963226, 58, 0.1, 'demo-device'),
('59c12acb-4095-44b1-9dc0-d1f857d2dc20', '<p>Had a conversation with my manager about career development. There are opportunities ahead but also expectations to meet. Feeling both excited and slightly anxious about the next steps. Need to trust my abilities. Taking time to reflect on this experience has been incredibly valuable for my growth.</p>', 1762055341440, 1762055363226, 55, -1.9, 'demo-device'),
('081e8430-06b5-437e-b213-e3b10353ba24', '<p>Attended a networking event tonight. Met some interesting people but social interactions always drain my energy. Introvert problems. Trying to push my comfort zone while also honoring my need for downtime. I''m committed to continuing this practice and seeing how it transforms my daily life.</p>', 1762141741440, 1762141763226, 54, 2.6, 'demo-device'),
('c52aeca8-5820-4ce9-bbc3-85dc7b7fa47f', '<p>Meal prepped for the week which felt productive. Eating healthier has been a goal but consistency is hard. Some weeks I nail it, others I rely on takeout. Trying to find sustainable habits instead of perfection. These moments of clarity help me stay grounded and focused on what truly matters.</p>', 1762228141440, 1762228163226, 57, 0.5, 'demo-device'),
('4ec9280a-e38d-4fc7-bfcf-5799c05c4b8e', '<p>Thinking about where I want to be in five years. Career goals, personal growth, relationships. It feels both exciting and overwhelming to think long-term. Taking it one year at a time for now. Grateful for the opportunity to learn and grow through these everyday experiences and challenges.</p>', 1762314541440, 1762314563226, 54, -0.8, 'demo-device'),
('fcd98ca7-4f7e-4b09-aa0f-a6d050bb10a3', '<p>Tried a new creative project today. Results were mixed but the process was enjoyable. Creativity does not always have to produce something perfect. Sometimes it is just about exploring and experimenting. This kind of mindful reflection is exactly what I need to maintain balance and perspective.</p>', 1762919341440, 1762919363226, 53, 1.9, 'demo-device'),
('18dcd9da-4e49-4e4e-a762-0a2ccb148fe6', '<p>Anxiety has been really high this week. Work stress is bleeding into every area of my life. Feel like I cannot turn my brain off. Need to talk to my therapist about coping strategies because this is not sustainable. Excited to build on this momentum and see what positive changes emerge over time.</p>', 1763005741440, 1763005763226, 60, -2.1, 'demo-device'),
('527fdae1-90ef-403c-9bc8-0ad66a925af1', '<p>Had a frustrating day at work. Client changed requirements last minute and now we are scrambling. Team morale is low and I feel like we are fighting an uphill battle. Trying to stay professional but I am exhausted. Appreciating the small wins and learning from setbacks as I move forward each day.</p>', 1763092141440, 1763092163226, 58, 0.7, 'demo-device'),
('a9cd8285-7378-4aac-8ed7-7c352b9f4c52', '<p>Got some concerning news from my doctor about test results. Nothing definitive yet but need more tests. Health anxiety is spiraling and I cannot stop googling symptoms. Need to stay grounded and wait for facts. This process of self-discovery continues to reveal new insights about my patterns and habits.</p>', 1763178541440, 1763178563226, 56, -2.5, 'demo-device'),
('f473c76f-eb30-4c23-b782-49e37a873e46', '<p>Argument with my partner left me feeling disconnected. We were both stressed and said things we did not mean. Communication breaks down when we are overwhelmed. Need to repair this but not sure where to start. Recognizing these patterns helps me make more intentional choices in how I spend my energy.</p>', 1763264941440, 1763264963226, 57, 1.3, 'demo-device'),
('50c97336-de8e-49d5-b8cc-47340feb8bca', '<p>Feeling stuck in my career lately. Same responsibilities, same challenges, no growth. Watching peers advance while I feel stagnant. Maybe I need to make a change but the uncertainty is paralyzing. Looking forward to seeing where this journey takes me in the coming weeks.</p>', 1763351341440, 1763351363226, 53, -1.7, 'demo-device'),
('0eae05fa-a482-425c-91d9-b000814a8750', '<p>Skipped the gym for the third day in a row. Motivation is nonexistent and I feel guilty about it. The cycle of feeling bad then avoiding what would make me feel better is so frustrating. Taking time to reflect on this experience has been incredibly valuable for my growth.</p>', 1763437741440, 1763437763226, 54, -0.9, 'demo-device'),
('5ec1794f-b29f-4797-a151-0b250252cdc5', '<p>Social anxiety has been intense lately. Canceled plans twice this week because the thought of being around people felt overwhelming. Isolating myself but also feeling lonely. It is a confusing contradiction. I''m committed to continuing this practice and seeing how it transforms my daily life.</p>', 1760500141440, 1760500163226, 55, -2.0, 'demo-device'),
('0c0448b0-ff1a-4550-9bf9-fef15e1e571c', '<p>Family conflict is weighing on me. Old wounds resurfacing and nobody seems willing to address the real issues. Feel caught in the middle and exhausted from trying to keep the peace. Need boundaries. These moments of clarity help me stay grounded and focused on what truly matters.</p>', 1760845741440, 1760845763226, 56, 2.4, 'demo-device'),
('e06b24b4-15ae-4438-a7fd-59bda0e04ae5', '<p>Having one of those days where everything feels hard. Work is stressful, relationships feel strained, even basic tasks feel overwhelming. Trying to remember that bad days pass but right now it is difficult to see the light. Grateful for the opportunity to learn and grow through these everyday experiences and challenges.</p>', 1761191341440, 1761191363226, 59, -2.2, 'demo-device');
